  \"2015-07-08T19:24:55.127101\",\n\t\"name\": \"antarctic-ice-velocity-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This compilation of recent ice velocity
  data of the Antarctic ice sheet is intended for use by the polar scientific community.
  The data are presented in tabular form (ASCII), containing latitude, longitude,
  speed, bearing, and error ranges. A metadata header describes the source of the
  data, the time of measurement, and gives details on measurement accuracy and precision.
  The tables are available for ftp transfer.nnWeb pages developed specifically for
  this data set provide detailed information for viewing and selecting the velocity
  data. These pages contain large satellite image maps (available as jpeg files).
  The data sets used to create these images were contributed by several investigators,
  generally from already published work. Both in situ and image-based methods are
  used.nnReferences for the data sets are included with the data tables. If you have
  well-characterized Antarctic ice velocity data you would like to contribute to this
  site, please contact teds@icehouse.colorado.edu. If you have any questions concerning
  the relevance of these data to your work please contact NSIDC User Services.\",\n\t\"license_title\":
